import { BtnStoreCancel } from "./../../services/BtnStoreCancel";
import { FormFeld } from "../../services/FormFeld";

import React, { useState, useRef, useCallback } from "react";

import { Toast } from "primereact/toast";

export function VereinEditForm({
  modusNeuerVerein,
  onSpeichern,
  onAbbruch,
  verein,
}) {
  const toast = useRef(null);

  const club = verein;

  const createUpdateVerein = useCallback(() => {
    if (vereinsName.length === 0 || vereinsKurz.length === 0) {
      toast.current.show({
        severity: "warn",
        summary: "Achtung",
        detail:
          "mindestens Vereinsname und Kurzbezeichnung m端ssen eingegeben werden!",
        life: 3000,
      });
    } else {
      const neuerVerein = {
        verein_name: vereinsName,
        verein_kurz: vereinsKurz,
        verein_strasse: vereinsStrasse,
        verein_plz: vereinsPLZ,
        verein_ort: vereinsOrt,
        verein_telefon_privat: vereinsTelefon,
        verein_bankname: vereinsBank,
        verein_konto_inhaber: vereinsKontoInhaber,
        verein_ki_anschrift: vereinsKontoInhaberAdresse,
        verein_iban: vereinsIBAN,
        verein_bic: vereinsBIC,
      };
      console.log
      onSpeichern(neuerVerein);
    }
  });

  let vereinsNameTemp = "";
  let vereinsKurzTemp = "";
  let vereinsStrasseTemp = "";
  let vereinsPLZTemp = "";
  let vereinsOrtTemp = "";
  let vereinsTelefonTemp = "";
  let vereinsBankTemp = "";
  let vereinsKontoInhaberTemp = "";
  let vereinsKontoInhaberAdresseTemp = "";
  let vereinsIBANTemp = "";
  let vereinsBICTemp = "";

  if (!modusNeuerVerein) {
    extractVerein2();
  }

  const [vereinsName, setVereinsName] = useState(vereinsNameTemp);
  const [vereinsKurz, setVereinsKurz] = useState(vereinsKurzTemp);
  const [vereinsStrasse, setVereinsStrasse] = useState(vereinsStrasseTemp);
  const [vereinsPLZ, setVereinsPLZ] = useState(vereinsPLZTemp);
  const [vereinsOrt, setVereinsOrt] = useState(vereinsOrtTemp);
  const [vereinsTelefon, setVereinsTelefon] = useState(vereinsTelefonTemp);
  const [vereinsBank, setVereinsBank] = useState(vereinsBankTemp);
  const [vereinsKontoInhaber, setVereinsKontoInhaber] = useState(
    vereinsKontoInhaberTemp
  );
  const [vereinsKontoInhaberAdresse, setVereinsKontoInhaberAdresse] = useState(
    vereinsKontoInhaberAdresseTemp
  );
  const [vereinsIBAN, setVereinsIBAN] = useState(vereinsIBANTemp);
  const [vereinsBIC, setVereinsBIC] = useState(vereinsBICTemp);

  return (
    <>
      <Toast ref={toast} />
      <div className="grid m-auto w-11">
        {FormFeld(vereinsName, "Vereinsname", false, setVereinsName)}
        {FormFeld(vereinsKurz, "Abk端rzung", false, setVereinsKurz)}
        {FormFeld(vereinsStrasse, "Strasse", false, setVereinsStrasse)}
        {FormFeld(vereinsPLZ, "PLZ", false, setVereinsPLZ)}
        {FormFeld(vereinsOrt, "Ort", false, setVereinsOrt)}
        {FormFeld(vereinsTelefon, "Telefon", false, setVereinsTelefon)}
        {FormFeld(vereinsBank, "Bank", false, setVereinsBank)}
        {FormFeld(
          vereinsKontoInhaber,
          "Kontoinhaber",
          false,
          setVereinsKontoInhaber
        )}
        {FormFeld(
          vereinsKontoInhaberAdresse,
          "Kontoinhaber Adresse",
          false,
          setVereinsKontoInhaberAdresse
        )}
        {FormFeld(vereinsIBAN, "IBAN", false, setVereinsIBAN)}
        {FormFeld(vereinsBIC, "BIC", false, setVereinsBIC)}
      </div>
      <BtnStoreCancel
        createUpdate={createUpdateVerein}
        onAbbruch={onAbbruch}
      />
    </>
  );

  function extractVerein2() {
    for (const property in club) {
      switch (property) {
        case "verein_name":
          vereinsNameTemp = club[property];
          break;
        case "verein_kurz":
          vereinsKurzTemp = club[property];
          break;
        case "verein_strasse":
          vereinsStrasseTemp = club[property];
          break;
        case "verein_plz":
          vereinsPLZTemp = club[property];
          break;
        case "verein_ort":
          vereinsOrtTemp = club[property];
          break;
        case "verein_telefon_privat":
          vereinsTelefonTemp = club[property];
          break;
        case "verein_bankname":
          vereinsBankTemp = club[property];
          break;
        case "verein_konto_inhaber":
          vereinsKontoInhaberTemp = club[property];
          break;
        case "verein_ki_anschrift":
          vereinsKontoInhaberAdresseTemp = club[property];
          break;
        case "verein_iban":
          vereinsIBANTemp = club[property];
          break;
        case "verein_bic":
          vereinsBICTemp = club[property];
          break;
        default:
          //console.log("Feld nicht zugewiesen");
          break;
      }
    }
  }
}
